import React from 'react'
import styled from 'styled-components'

const LogoText = styled.h1`
 font-family: 'Poppins', bold;
 font-size: ${props => props.theme.fontxl};
`

const Logo = () => {
  return (
    <LogoText>
        <Link to="/">
        Silly Science
        </Link>
        
    </LogoText>
  )
}

export default Logo
